import { buildAlphaNumericPercentArbitrary } from './CharacterRangeArbitraryBuilder.js';
import { stringOf } from '../../stringOf.js';
export function buildUriQueryOrFragmentArbitrary() {
    const others = ['-', '.', '_', '~', '!', '$', '&', "'", '(', ')', '*', '+', ',', ';', '=', ':', '@', '/', '?'];
    return stringOf(buildAlphaNumericPercentArbitrary(others));
}
